package com.ufgov.zc.client.component.table.codecelleditor;import java.awt.Component;import javax.swing.AbstractCellEditor;import javax.swing.JTable;import javax.swing.table.TableCellEditor;import com.ufgov.zc.client.common.WorkEnv;import com.ufgov.zc.client.component.element.OriginTableSelectField;import com.ufgov.zc.common.commonbiz.model.Origin;public class NextYearOriginTableSelectCellEditor extends AbstractCellEditor implements TableCellEditor {  private static final long serialVersionUID = -1014964575090820890L;  private OriginTableSelectField editorComponent = new OriginTableSelectField(20, WorkEnv.getInstance().getTransNd() + 1);  public NextYearOriginTableSelectCellEditor() {  }  public Component getTableCellEditorComponent(JTable table, Object value, boolean isSelected, int row,  int column) {    editorComponent.setValueByCode((String) value);    return editorComponent;  }  public Object getCellEditorValue() {    String code = null;    Origin value = editorComponent.getOrigin();    if (value != null) {      code = value.getCode();    }    return code;  }}